/**
 * File Description: This component is used to display a single result from the search and enables interaction
 * Author(s): Sashank Pindiproli
 * Date of Creation: 03/02/2020
 */

import React from 'react';
import styled from 'styled-components';

/**
 * 
 * SAMPLE DATA : {
    "arrivalTime": "16:30",
    "date": "2020/11/01",
    "departureTime": "14:00",
    "destination": "Bengaluru (BLR)",
    "flightNo": "AI-111",
    "name": "Air India",
    "origin": "Delhi (DEL)",
    "price": 5217
  }
 */

const FlightResult = ({ item }) => {
  const data = {
    arrivalTime: '16:30',
    date: '2020/11/01',
    departureTime: '14:00',
    destination: 'Bengaluru (BLR)',
    flightNo: 'AI-111',
    name: 'Air India',
    origin: 'Delhi (DEL)',
    price: 5217,
  };
  return (
    <StyledContainer id="search-results__item">{item.origin}</StyledContainer>
  );
};
const StyledContainer = styled.div`
  background: red;
`;

export default FlightResult;
